import React from "react"

class Navbar extends React.Component{
    render(){
        return(
            <section id="header" class="dark">
            <header>
                <h1>What it means to meditate</h1>
                <p>Are you stresses? take a walk far from home and find a serene place to think about everything.
                </p>
            </header>
            <footer>
                <a href="#first" class="button scrolly">Proceed to second phase</a>
            </footer>
        </section>
        )
    }
}

export default Navbar
